    render(){
      return(
        <>

        <Wishlist mainList={this.props.mainList} wishList={this.props.wishList} />

        <ul>

        { this.props.mainList.map((amiibo, i) => {
          return (
          <li key={i} >

            <img  src={amiibo.image} />
            <p>{amiibo.name}</p>
            <button className={i} onClick={() => this.addToList(i)}>Add to Wishlist</button>
          </li>
        )
